import './App.css';
import emotion1 from "./img/emotion1.png";
import emotion2 from "./img/emotion2.png";
import emotion3 from "./img/emotion3.png";
import emotion4 from "./img/emotion4.png";
import emotion5 from "./img/emotion5.png";


function App() {
  return (
    <div className="App">
      <h1>감정 일기장</h1>
      <img alt = "emotion1" src = {emotion1}/>
      <img alt = "emotion2" src = {emotion2}/>
      <img alt = "emotion3" src = {emotion3}/>
      <img alt = "emotion4" src = {emotion4}/>
      <img alt = "emotion5" src = {emotion5}/>
    </div>
  );
}

export default App;
